import React, { Component } from 'react'
import Output from './output';

export default class Input extends Component {
    constructor(props){
        super(props);
        this.state = {
            makanan : 'Bakso'
        }
    }
    render() {
        return (
            <div>
                <h2>{this.state.makanan}</h2>
                <button onClick={() => this.setState({makanan: 'Soto'})}>Ganti</button>
                <Output makanan = {this.state.makanan}/>
            </div>
        )
    }
}
